export default function RenderList() {
  const Fruits = [
    {
      fruit: "apple",
      vegetable: "potato",
    },
    {
      vehicle: "car",
      earphone: "airpods",
    },
  ];

  const ListItems = Fruits.map((Fruits) => <li>{Fruits}</li>);

  return <ul>{ListItems}</ul>;
}
